import React, {useState, useEffect} from "react";

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/api')
    .then(res => res.json())
    .then(res => setData(res.body))
  }, []);

  return (
    <div className="container">
      {
        !data ? "Loading..." : data
      }
    </div>
  );
}

export default App;
